import moment from "moment";

export const convertDateToHHmm = (d: Date) => {
	// if (d) return moment(new Date(d).toString()).format('HH:mm');
	//
	//
	console.log(moment(new Date(d).toString()).format('HH:mm'));
	return '??';
}
